    geo_json_45d62cac70f6642bde6e8026a0c22f8b.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["pk_uid", "tipo_ele"];
    let aliases = ["ID:", "Type:"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>

            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
